import React, { useState, useEffect } from 'react';
import authService from '../../services/authService';

import VerCursos from './VerCursos';
import VerCurso from './VerCurso';
import Recursos from './Recursos';
import VerForos from './VerForos';
import TomarAsistencias from './TomarAsistencias';
import VerAsistencias from './VerAsistencias';
import VerTareas from './VerTareas';
import CrearTarea from './CrearTarea'; // Importa CrearTarea correctamente
import './profesorCss/profesor.css';

const ProfesorDashboard = () => {
    const [user, setUser] = useState(null);
    const [selectedOption, setSelectedOption] = useState('');
    const [subSelectedOption, setSubSelectedOption] = useState('');
    const [subSubSelectedOption, setSubSubSelectedOption] = useState('');
    const [currentCursoId, setCurrentCursoId] = useState(null);

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const userData = await authService.getUserData();
                setUser(userData);
            } catch (error) {
                console.error("Error al obtener datos del usuario:", error);
            }
        };
        fetchUserData();
    }, []);

    const handleMenuClick = (option) => {
        setSelectedOption(option);
        setSubSelectedOption('');
        setSubSubSelectedOption('');
    };

    const handleSubMenuClick = (subOption) => {
        setSubSelectedOption(subOption);
        setSubSubSelectedOption('');
    };

    const handleSubSubMenuClick = (subSubOption, idAsignatura = null) => {
        setSubSubSelectedOption(subSubOption);
        if (idAsignatura) setCurrentCursoId(idAsignatura);
    };

    if (!user) {
        return <div>Cargando...</div>;
    }

    return (
        <div className="dashboard-container">
            <div className="sidebar">
                <nav className="menu">
                    <ul>
                        <li>
                            <button onClick={() => handleMenuClick('cursos')}>Cursos</button>
                            {selectedOption === 'cursos' && (
                                <ul className="submenu">
                                    <li>
                                        <button onClick={() => handleSubMenuClick('verCursos')}>Ver Cursos</button>
                                        {subSelectedOption === 'verCursos' && (
                                            <ul className="submenu">
                                                <li>
                                                    <button onClick={() => handleSubSubMenuClick('recursos', currentCursoId)}>Recursos</button>
                                                </li>
                                            </ul>
                                        )}
                                    </li>
                                    <li>
                                        <button onClick={() => handleSubMenuClick('foros')}>Foros</button>
                                        {subSelectedOption === 'foros' && (
                                            <ul className="submenu">
                                                <li><button onClick={() => handleSubSubMenuClick('verForos', currentCursoId)}>Ver Foros</button></li>
                                            </ul>
                                        )}
                                    </li>
                                    <li>
                                        <button onClick={() => handleSubMenuClick('asistencia')}>Asistencia</button>
                                        {subSelectedOption === 'asistencia' && (
                                            <ul className="submenu">
                                                <li><button onClick={() => handleSubSubMenuClick('verAsistencias', currentCursoId)}>Ver Asistencias</button></li>
                                                <li><button onClick={() => handleSubSubMenuClick('tomarAsistencias', currentCursoId)}>Tomar Asistencias</button></li>
                                            </ul>
                                        )}
                                    </li>
                                </ul>
                            )}
                        </li>
                    </ul>
                </nav>
            </div>
            <div className='main-content'>
                <div className='header'>
                    <h1>Bienvenido, {user.nombre}</h1>
                    <button onClick={authService.cerrarSesion}>Cerrar Sesi√≥n</button>
                </div>
                <div className='content'>
                    {subSelectedOption === 'verCursos' && !subSubSelectedOption && <VerCursos setSubSubSelectedOption={handleSubSubMenuClick} />}
                    {subSubSelectedOption === 'verCurso' && <VerCurso idAsignatura={currentCursoId} />}
                    {subSubSelectedOption === 'recursos' && <Recursos idAsignatura={currentCursoId} />}
                    {subSubSelectedOption === 'verTareas' && <VerTareas idCursoAsignatura={currentCursoId} setSubSubSelectedOption={handleSubSubMenuClick} />}
                    {subSubSelectedOption === 'crearTarea' && <CrearTarea idCursoAsignatura={currentCursoId} />} 
                    {subSubSelectedOption === 'verForos' && <VerForos idAsignatura={currentCursoId} />}
                    {subSubSelectedOption === 'verAsistencias' && <VerAsistencias idCursoAsignatura={currentCursoId} />}
                    {subSubSelectedOption === 'tomarAsistencias' && <TomarAsistencias idCursoAsignatura={currentCursoId} />}
                </div>
            </div>
        </div>
    );
};

export default ProfesorDashboard;
